import React from "react";
import "../../../Styles/Pages/Cart/CartOrder.scss";

function CartOrder() {
  return (
    <div className='cartOrder'>
      <div className='cartOrder__header'>
        <h3>Order Summary</h3>
      </div>
      <div className='orderProduct'>
        <div>
          <h4>War Arena: Titan Wars x 1</h4>
          <p>Game</p>
        </div>
        <h3>72$</h3>
      </div>
      <div className='orderProduct'>
        <div>
          <h4>Glymber</h4>
          <p>Game</p>
        </div>
        <h3>72$</h3>
      </div>
    </div>
  );
}

export default CartOrder;
